  overflow: hidden;
}

.container-md {
  overflow: visible;
  max-width: 70.75rem;
}

.body--noscroll {
  overflow: hidden;
}

.page_screen_full {
  height: 100vh !important;
}

.page {
  background-color: #1d1c39;
  position: relative;
  z-index: 0;
  /*   transition: background 0.2s ease-in-out 0.2s; */
}
.page:after {
  position: absolute;
  content: url("../assets/svg/main/main/Ellipse.svg");
  top: 0;
  bottom: auto;
  left: auto;
  right: 0;
  margin: auto;
  z-index: -1;
}
.page__wrapper {
  position: relative;
}
.page__contact {
  height: calc(100vh - 200px !important;
}
.page__navigtion {
  padding-left: 0.75rem;
  position: absolute;
  content: "";
  top: 6.75rem;
  bottom: auto;
  left: 0;
  right: auto;
  margin: auto;
}
.page__sidebar {
  height: calc(100% - 66px;
  width: 100%;
  position: absolute;
  content: "";
  top: 0;
  bottom: auto;
  left: 0;
  right: auto;
  margin: auto;
  height: 100%;
  visibility: hidden;
  -webkit-transition: all 0.3s ease-in-out;
  transition: all 0.3s ease-in-out;
}
.page__sidebar--active {
  visibility: visible;
}

.page--mail {
  background: url("../assets/backgrounds/mail/main-background.png") no-repeat center center/cover;
}

.page--base {
  background: url("../assets/backgrounds/base/main-background.png") no-repeat center center/cover;
}

